import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="order">
        <label>Order:<input type="text" label="Order id"></input></label><br/>
        <label>Cliente:<input type="text" label="Order id"></input></label><br/>
        <label>Shipping Address:<input type="text" label="Order id"></input></label><br/>
        <label>Shipping Promise:<input type="date" label="Order id"></input></label><br/>
      </div>
    </div>
  );
}

export default App;
